import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import Button from "@mui/material/Button";
import "./Index.css";

const Index = () => {
  return(
    
    <div className="small-section">
    <Box className="Box">
      <Card className="card">
        <h2>This is the title</h2>
        <hr />
        <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Suscipit adipisci minus voluptatem, necessitatibus tempore veniam enim voluptate facere unde sint deserunt totam eaque perspiciatis? Soluta earum est ratione hic, repudiandae officiis ducimus optio!</p>
      </Card>
    </Box>
  </div>
  )};

export default Index;
